package com.amandris.clients.service.vo;import java.io.Serializable;import java.util.Date;public class Calendar implements Serializable{	private Integer 	id;	private Integer 	sellerId;	private Date 		date;	private Integer 	hourStatusConst;	private Seller 		seller;		private static final long serialVersionUID = 6526471155622776008L;		public Date getDate() {		return date;	}	public void setDate(Date date) {		this.date = date;	}	public Integer getHourStatusConst() {		return hourStatusConst;	}	public void setHourStatusConst(Integer hourStatusConst) {		this.hourStatusConst = hourStatusConst;	}	public Integer getId() {		return id;	}	public void setId(Integer id) {		this.id = id;	}	public Seller getSeller() {		return seller;	}	public void setSeller(Seller seller) {		this.seller = seller;	}	public Integer getSellerId() {		return sellerId;	}	public void setSellerId(Integer sellerId) {		this.sellerId = sellerId;	}}